import React from 'react';

function HomePage() {
  return (
    <div>
      <h1>Welcome to VehicleVerse</h1>
      <p>Explore, Buy, Sell, and Rent Cars and Bikes.</p>
      <a href="/buy">Buy</a>
      <a href="/sell">Sell</a>
      <a href="/rent">Rent</a>
      <a href="/profile">Profile</a>
    </div>
  );
}

export default HomePage;
